    id: 16,
    name: "Geoglo Pexel 3a XL 2018 Plus",
    slug: "geoglo-pexel-3a-xl-2018-plus",
    permalink: "https://shippr.store/product/geoglo-pexel-3a-xl-2018-plus/",
    date_created: "2019-10-04T02:33:53",
