    id: 25,
    name: "Quantum Vsquare Port Usb Hub",
    slug: "quantum-vsquare-port-qhm6633",
    permalink: "https://shippr.store/product/quantum-vsquare-port-qhm6633/",
    date_created: "2019-10-06T18:52:55",
    date_created_gmt: "2019-10-06T18:52:55",
    date_modified: "2022-03-26T09:18:05",
