    id: 26,
    name: "Cosmic Byte GS410 Headset with Mic",
    slug: "cosmic-byte-gs410-headset-with-mic",
    permalink: "https://shippr.store/product/cosmic-byte-gs410-headset-with-mic/",
    date_created: "2019-10-07T01:58:06",
