    id: 8844,
    name: "Ynos Airepx XZ2 Unlimited 2016",
    slug: "ynos-airepx-xz2-unlimited-2016",
    permalink: "https://shippr.store/product/ynos-airepx-xz2-unlimited-2016/",
    date_created: "2019-10-06T19:36:22",
    date_created_gmt: "2019-10-06T19:36:22",
    date_modified: "2022-03-26T09:18:06",
    date_modified_gmt: "2022-03-26T09:18:06",
    type: "simple",
    status: "publish",
    featured: false,
    catalog_visibility: "visible",
    description:
      '<p>Apple iPhone 6s smartphone was launched in September 2015. The phone comes with a 4.70-inch touchscreen display with a resolution of 750x1334 pixels at a pixel density of 326 pixels per inch (ppi) and an aspect ratio of 16:9. Apple iPhone 6s is powered by a 1.84GHz dual-core A9 processor. It comes with 2GB of RAM. The Apple iPhone 6s runs iOS 9 and is powered by a 1,715mAh non-removable battery. As far as the cameras are concerned, the Apple iPhone 6s on the rear packs a 12-megapixel camera with an f/2.2 aperture and a pixel size of 1.22-micron. The rear camera setup has phase detection autofocus. It sports a 5-megapixel camera on the front for v selfies, with an f/2.2 aperture. </p>\n<p>Connectivity options on the Apple iPhone 6s include Wi-Fi 802.11 a/b/g/n/ac, GPS, Bluetooth v4.20, NFC, Lightning, 3G, and 4G (with support for Band 40 used by some LTE networks in India). Sensors on the phone include accelerometer, ambient light sensor, barometer, compass/ magnetometer, gyroscope, proximity sensor, and fingerprint sensor.</p>\n<p>\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t<img width="1000" height="1000" src="https://shippr.store/wp-content/uploads/2019/10/product-09.jpg" alt="" loading="lazy" /><br />\n\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t<img width="1000" height="1000" src="https://shippr.store/wp-content/uploads/2019/10/product-10.jpg" alt="" loading="lazy" />\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t</p>\n<p><strong>Camera: Rear image quality</strong>: Still image quality using the rear facing (main) camera. It is based on objective and subjective judgments of test images, which includes evaluating resolution, dynamic range, color accuracy, and visual noise.</p>\n<p><strong>Camera: Rear 1080p video quality:</strong> Video quality is based on the judgments of trained panelists who viewed recorded video images shot at the highest quality setting available (1080p max.) in multiple lighting conditions.</p>\n<p><strong>Camera: Selfie image quality:</strong> Still image quality using the front facing (selfie) camera. It is based on objective and subjective judgments of test images, which includes evaluating resolution, color accuracy, and visual noise in multiple lighting conditions.</p>\n<p>The Apple iPhone 6s is part of the Cell phone &amp; service test program at Consumer Reports. In our lab tests, Cell phone &amp; service models like the iPhone 6s are rated on multiple criteria, such as those listed below. The Apple iPhone 6s measures 138.30 x 67.10 x 7.10mm (height x width x thickness) and weighs 143.00 grams. It was launched in Silver, Gold, Space Grey, and Rose Gold colours. It bears a metal body.</p>\n',
    short_description:
      '<ul>\n<li id="tw-target-text" class="tw-data-text tw-text-large tw-ta" dir="ltr" data-placeholder="Bản dịch"><span lang="en" tabindex="0">Network connection: 2G, 3G, 4G. </span></li>\n<li id="tw-target-text" class="tw-data-text tw-text-large tw-ta" dir="ltr" data-placeholder="Bản dịch"><span lang="en" tabindex="0">Internal memory: 64GB. </span></li>\n<li id="tw-target-text" class="tw-data-text tw-text-large tw-ta" dir="ltr" data-placeholder="Bản dịch"><span lang="en" tabindex="0">Manufacturer: Sony. </span></li>\n</ul>\n',
